import unittest


def is_nested(string):
    """
    Given a string consisting of parenthesis and brackets, determine if the string is properly nested.
    """
    stack = []
    for char in string:
        if char in '({[':
            stack.append(char)
        else:
            if not stack:
                return False
            open_char = stack.pop()
            if (char == ')' and open_char != '(') or \
               (char == '}' and open_char != '{') or \
               (char == ']' and open_char != '['):
                return False
    return not stack


class TestIsNested(unittest.TestCase):
    def test_is_nested(self):
        self.assertEqual(is_nested("()"), True)
        self.assertEqual(is_nested("()[]{}"), True)
        self.assertEqual(is_nested("(]"), False)
        self.assertEqual(is_nested("([)]"), False)
        self.assertEqual(is_nested("{[]()}"), True)
